// ***************************Reportes
function mostrarDatos(a, b, c, d, e, f, g, h) {
	document.getElementById("eFolio").value = a;
	document.getElementById("eFecha").value = b;
	document.getElementById("eMatricula").value = c;
	document.getElementById("eCCT").value = d;
	document.getElementById("eNombreCompleto").value = e;
	document.getElementById("eMotivo").value = f;
	document.getElementById("eDescrpcion").value = g;
	document.getElementById("eCanalizacion").value = h;
}

function imprimir() {
	var imgData = 'data:image/jpeg;base64,'

	var doc = new jsPDF()
	var folio = document.getElementById("eFolio").value;
	var fecha = document.getElementById("eFecha").value;
	var matricula = document.getElementById("eMatricula").value;
	var cct = document.getElementById("eCCT").value;
	var nombre = document.getElementById("eNombreCompleto").value;
	var motivo = document.getElementById("eMotivo").value;
	var descrip = document.getElementById("eDescrpcion").value;
	var canaliza = document.getElementById("eCanalizacion").value;

	doc.addImage(imgData, 'JPEG', 20, 15, 20, 20)
	doc.setFontSize(20)
	doc.setFontType('bold')
	doc.text(45, 23, 'SIDEC | Sistema de Expedientes Controlados')
	doc.setFontSize(18)
	doc.text(45, 32, 'Reporte a estudiante')
	doc.setFontSize(16)
	doc.text(145, 40, 'Folio:')
	doc.text(145, 50, 'Fecha:')
	doc.text(20, 50, 'Matrcula:')
	doc.text(20, 65, 'Nombre Completo:')
	doc.text(20, 80, 'Realizado por:')
	doc.text(20, 95, 'Motivo:')
	doc.text(20, 110, 'Descripcin:')
	doc.text(20, 125, 'Canalizacin:')

	doc.setFontSize(14)
	doc.setFontType('normal')
	doc.text(165, 40, folio)
	doc.text(170, 50, fecha)
	doc.text(50, 50, matricula)
	doc.text(75, 65, nombre)
	doc.text(65, 80, cct)
	doc.text(45, 95, motivo)
	doc.text(60, 110, descrip)
	doc.text(60, 125, canaliza)
	doc.save("SIDEC_Reporte_" + matricula + ".pdf");
}

function pregunta() {
	Swal.fire({
		title: 'Quiere reportarlo?',
		text: "El estudiante reportado debera acatar las ordenes",
		icon: 'warning',
		showCancelButton: true,
		confirmButtonColor: '#6c757d',
		cancelButtonColor: '#3085d6',
		confirmButtonText: 'Si, Realizar!'
	}).then((result) => {
		if (result.value) document.getElementById("enviarForm").click();
	})
}

